import { useState } from "react";

type Row = {
  name: string;
  device: string;
  path: string;
  status: "scheduled" | "available";
};

const sampleData: Row[] = [
  // {
  //   id: 1,
  //   name: "File1",
  //   device: "Laptop",
  //   path: "/files/file1",
  //   status: "Available",
  // },
  // {
  //   id: 2,
  //   name: "File2",
  //   device: "Tablet",
  //   path: "/files/file2",
  //   status: "Unavailable",
  // },
  // {
  //   id: 3,
  //   name: "File3",
  //   device: "Phone",
  //   path: "/files/file3",
  //   status: "Available",
  // },
  {name: 'smss.exe', device: 'Stark', path: '\\Device\\HarddiskVolume2\\Windows\\System32\\smss.exe', status: 'scheduled'},
  {name: 'netsh.exe', device: 'Targaryen', path: '\\Device\\HarddiskVolume2\\Windows\\System32\\netsh.exe', status: 'available'},
  {name: 'uxtheme.dll', device: 'Lanniester', path: '\\Device\\HarddiskVolume1\\Windows\\System32\\uxtheme.dll', status: 'available'},
  {name: 'cryptbase.dll', device: 'Martell', path: '\\Device\\HarddiskVolume1\\Windows\\System32\\cryptbase.dll', status: 'scheduled'},
  {name: '7za.exe', device: 'Baratheon', path: '\\Device\\HarddiskVolume1\\temp\\7za.exe', status: 'scheduled'}

];

export default function Datagrid() {
  const [selectedRows, setSelectedRows] = useState<number[]>([]);
  const allAvailable = selectedRows.every(
    (id) => sampleData.find((row) => row.id === id)?.status === "Available"
  );

  const handleSelectRow = (id: number) => {
    setSelectedRows((prev) =>
      prev.includes(id) ? prev.filter((rowId) => rowId !== id) : [...prev, id]
    );
  };

  const handleSelectAll = () => {
    if (selectedRows.length === sampleData.length) {
      setSelectedRows([]);
    } else {
      setSelectedRows(sampleData.map((row) => row.id));
    }
  };

  const isChecked = selectedRows.length === sampleData.length;
  const isIndeterminate =
    selectedRows.length > 0 && selectedRows.length < sampleData.length;

  const handleDownload = () => {
    alert(
      "Selected Rows: " +
        JSON.stringify(
          sampleData.filter((row) => selectedRows.includes(row.id)),
          null,
          2
        )
    );
  };

  return (
    <div>
      <h2>Datagrid</h2>
      <label>
        <input
          type="checkbox"
          checked={isChecked}
          ref={(el) => el && (el.indeterminate = isIndeterminate)}
          onChange={handleSelectAll}
        />
        {selectedRows.length
          ? `${selectedRows.length} Selected`
          : "None Selected"}
      </label>
      <table
         border={1}
        cellPadding="5"
        style={{ width: "100%", marginTop: "10px" }}
      >
        <thead>
          <tr>
            <th></th>
            <th>Name</th>
            <th>Device</th>
            <th>Path</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {sampleData.map((row) => (
            <tr key={row.id}>
              <td>
                <input
                  type="checkbox"
                  checked={selectedRows.includes(row.id)}
                  onChange={() => handleSelectRow(row.id)}
                />
              </td>
              <td>{row.name}</td>
              <td>{row.device}</td>
              <td>{row.path}</td>
              <td>
                {row.status === "Available" && (
                  <span style={{ color: "green", marginRight: "5px" }}>●</span>
                )}
                {row.status}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button
        onClick={handleDownload}
        disabled={!selectedRows.length || !allAvailable}
        style={{ marginTop: "10px" }}
      >
        Download Selected
      </button>
    </div>
  );
}
